import { apolloClient } from "../lib/graphql-client";
import { ApolloProvider } from '@apollo/react-hooks';

export default function App({ Component, pageProps }) {

  return (
    <ApolloProvider client={apolloClient}>
      <Component {...pageProps} />
    </ApolloProvider>
  );
}
